(239, 44, 'Секс поддержка для ног', 'Это приспособление для секса выполнено из искусственной кожи с металлическими клепками. Главное приспособление этой секс поддержки - зафиксировать ноги в приподнятом положении, что придает позе большей откровенности и доступности. \nОпустить ноги или спрятать интимные места от ласк в таком фиксаторе просто невозможно.', 0, 'B-ASM4', 5000, 0, 'черный', 'Искусственная кожа', '/goods_files/BDSM/B-ASM4/4205367475_1787528409.jpg', 'В наличии', 'seks-podderzhka-dlya-nog-239', 1, 100, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:24'),
