(291, 44, 'Набор БДСМ ', 'Бондаж рук и ног на жесткой сцепке. Металлическая распорка, кожаные широкие наручи и оковы застегивающие на замочки - вот все что нужно для того чтобы сковать раба так как вам будет угодно. Широкие наручники не оставят отпечатков, даже если раб будет вырываться или зафиксирован в неудобной позиции.', 0, 'GN-10821', 12000, 0, 'черный', 'Искусственная кожа, металл', '/goods_files/BDSM/GN-10821/56E7B904C28127DF05C238364E04AAF6.jpg', 'В наличии', 'nabor-bdsm-291', 1, 87, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:41:59'),
(292, 44, 'Набор БДСМ ', 'Фиксация для шеи и рук на жесткой сцепке. Металлическая основа и кожаные оковы, вот все что нужно для того чтобы сковать раба так как вам будет угодно. Широкие наручники и ошейник не оставят отпечатков, даже если раб будет вырываться или зафиксирован в неудобной позиции. Фиксатор шеи и рук - это идеальный девайс для бдсм сессий.', 0, 'B50-10024', 12000, 0, 'красный', 'Искусственная кожа, металл', '/goods_files/BDSM/B50-10024/QQ%E6%88%AA%E5%9B%BE20150901143202.jpg', 'В наличии', 'nabor-bdsm-292', 1, 88, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:41:59'),
(293, 44, 'Зажими для сосков', 'Зажимы для возбуждения сосков во время секса с резиновыми чехольчиками на концах. Клипсы со звенящими бубенцами придадут вашим интимным играм не только изысканности и игривости, но и приятное возбуждение, граничащее с болью.\n\nСтепень сжатия зажимов регулируется с помощью специального винта.', 0, 'LB-80220-001', 1500, 0, 'разные цвета', 'металл', '/goods_files/BDSM/LB-80220-001/51723458D497D3CEAB1E26D5EC074A5D.jpg', 'В наличии', 'zazhimi-dlya-soskov-293', 1, 9, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:46'),
